import React from 'react';
import { Link } from 'react-router-dom';
import { useSelector } from 'react-redux';
import { useNavigate } from 'react-router-dom';


export const Home = () => {
    const [movies, setMovies] = React.useState([]);
    const fetchData = () => {
        fetch('http://localhost:8080/movies')
            .then((res) => res.json())
            .then((data) => setMovies(data))

    }
    const moreDeatils=(e)=>{
            console.log(e.target.value)
    }
    React.useEffect(() => fetchData(), [movies])

    return (
        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(3,1fr)', gap: '15px' }}>
            {movies.map((e) => (
                <div key={e.id} style={{ border: '1px solid black' }}>
                    <p>{e.original_title}</p>
                    <p>{'release_date-'}{e.release_date}</p>
                    <img style={{ width: '200px' }} src={e.poster_path} />
                    <h6>{'original_language-'}{e.original_language}</h6>
                    <div style={{ display: 'grid', gridTemplateColumns: 'repeat(3,1fr)' }}>

                        <h6>{'popularity-'}{e.popularity}</h6>
                        <h6>{'vote_average-'}{e.vote_average}</h6>
                        <h6>{'vote_count-'}{e.vote_count}</h6>
                    </div>
                    <button style={{width:'100px',height:'30px'}} onClick={moreDeatils}>More Details</button>

                </div>
            ))}
        </div>
    )
}
